DROP TABLE IF EXISTS `attd_approve_info`;
CREATE TABLE `attd_approve_info` (
  `id` int(11) NOT NULL AUTO_INCREMENT COMMENT '主键',
  `emp_id` int(11) NOT NULL COMMENT '所属员工-提交审批人',
  `approve_days` double(11,2) NOT NULL COMMENT '请假、调休或出差时长',
  `approve_content` varchar(255) DEFAULT NULL COMMENT '请假事由',
  `approve_remark` varchar(255) DEFAULT NULL COMMENT '审批备注',
  `approve_type` int(11) NOT NULL COMMENT '审批事件类型 1-请假申请 2-调休申请 3-出差申请',
  `approve_time_start` datetime NOT NULL COMMENT '审批内的开始日期',
  `approve_time_end` datetime NOT NULL COMMENT '审批内的结束日期',
  `create_time` datetime NOT NULL DEFAULT CURRENT_TIMESTAMP COMMENT '审批提交时间',
  `approve_state` int(11) NOT NULL COMMENT '审批状态 0-等待提交 1-开始审批 2-审批中 3-审批通过 4-审批驳回',
  `update_time` datetime NOT NULL COMMENT '修改时间',
  PRIMARY KEY (`id`)
) ENGINE=InnoDB AUTO_INCREMENT=11 DEFAULT CHARSET=utf8;

